import React from 'react';
import './Discover.css';
import Discover from './DiscoverTrailers';

function HomeDiscover (props){
    let movieDiscovered;
    if(props.discovered){
        movieDiscovered=props.discovered.map(discover=>{
            return <Discover
         discover={discover} 
         key={discover.id}
         />

        })
    }

    let ontvDiscoverd;
    if(props.ontv){
        ontvDiscoverd=props.ontv.map(tv=>{
            return <Discover
            tv={tv} 
            key={tv.id}
            />
        })
    }
    return(
        <div className="content">
        <div className="title">
        <h3>Discover</h3>
        
       
        </div>
        <div className="discover">
        {movieDiscovered}
        </div>
        <h3>On Tv</h3>
        <div className="ontv">
        {ontvDiscoverd}
        </div>           

        </div>
    )
}

export default HomeDiscover;
